import styled from "styled-components";

const Container = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  width: 100%;
  background-color: black;
  padding-bottom: 5%;
  h1 {
    font-size: xx-large;
    color: white;
  }
`;
const Logo = styled.div`
  width: 200px;
  height: 200px;
  animation: rotate_image 10s linear infinite;
  transform-origin: 50% 50%;
  @keyframes rotate_image {
    100% {
      transform: rotate(360deg);
    }
  }
`;

const Rectangle = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  padding: 200px 0;
  border-width: 1px;
  border-color: white;
  border-style: solid;
  width: 90%;
  height: 100%;
`;

export function Intro() {
  return (
    <Container>
      <Rectangle>
        <Logo>
          <a href="#">
            <img
              src="./images/logo/logo_white.png"
              width="200"
              height="200"
              alt="untitled_logo"
            />
          </a>
        </Logo>
        <h1>
          "Hello, <strong>UNTITLED</strong>"
        </h1>
      </Rectangle>
    </Container>
  );
}
